import{_ as n}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as s,e}from"./app.069715d7.js";const t={},i=e(`<blockquote><p>\u5B50\u67E5\u8BE2\u6307\u4E00\u4E2A\u67E5\u8BE2\u8BED\u53E5\u5D4C\u5957\u5728\u53E6\u4E00\u4E2A\u67E5\u8BE2\u8BED\u53E5\u5185\u90E8\u7684\u67E5\u8BE2\uFF0C\u8FD9\u4E2A\u7279\u6027\u4ECEMySQL 4.1\u5F00\u59CB\u5F15\u5165\u3002</p><p>SQL \u4E2D\u5B50\u67E5\u8BE2\u7684\u4F7F\u7528\u5927\u5927\u589E\u5F3A\u4E86 SELECT \u67E5\u8BE2\u7684\u80FD\u529B\uFF0C\u56E0\u4E3A\u5F88\u591A\u65F6\u5019\u67E5\u8BE2\u9700\u8981\u4ECE\u7ED3\u679C\u96C6\u4E2D\u83B7\u53D6\u6570\u636E\uFF0C\u6216\u8005\u9700\u8981\u4ECE\u540C\u4E00\u4E2A\u8868\u4E2D\u5148\u8BA1\u7B97\u5F97\u51FA\u4E00\u4E2A\u6570\u636E\u7ED3\u679C\uFF0C\u7136\u540E\u4E0E\u8FD9\u4E2A\u6570\u636E\u7ED3\u679C\uFF08\u53EF\u80FD\u662F\u67D0\u4E2A\u6807\u91CF\uFF0C\u4E5F\u53EF\u80FD\u662F\u67D0\u4E2A\u96C6\u5408\uFF09\u8FDB\u884C\u6BD4\u8F83</p></blockquote><h2 id="\u5FEB\u901F\u5F00\u59CB" tabindex="-1"><a class="header-anchor" href="#\u5FEB\u901F\u5F00\u59CB" aria-hidden="true">#</a> \u5FEB\u901F\u5F00\u59CB</h2><h3 id="\u5B50\u67E5\u8BE2\u7684\u57FA\u672C\u4F7F\u7528" tabindex="-1"><a class="header-anchor" href="#\u5B50\u67E5\u8BE2\u7684\u57FA\u672C\u4F7F\u7528" aria-hidden="true">#</a> \u5B50\u67E5\u8BE2\u7684\u57FA\u672C\u4F7F\u7528</h3><p><img src="https://s2.loli.net/2022/09/14/KcsvArEJtBL8Ta1.png" alt="1554991054388.png" loading="lazy"></p><ul><li>\u5B50\u67E5\u8BE2\uFF08\u5185\u67E5\u8BE2\uFF09\u5728\u4E3B\u67E5\u8BE2\u4E4B\u524D\u4E00\u6B21\u6267\u884C\u5B8C\u6210\u3002</li><li>\u5B50\u67E5\u8BE2\u7684\u7ED3\u679C\u88AB\u4E3B\u67E5\u8BE2\uFF08\u5916\u67E5\u8BE2\uFF09\u4F7F\u7528 \u3002</li><li><strong>\u6CE8\u610F\u4E8B\u9879</strong><ul><li>\u5B50\u67E5\u8BE2\u8981\u5305\u542B\u5728\u62EC\u53F7\u5185</li><li>\u5C06\u5B50\u67E5\u8BE2\u653E\u5728\u6BD4\u8F83\u6761\u4EF6\u7684\u53F3\u4FA7</li><li>\u5355\u884C\u64CD\u4F5C\u7B26\u5BF9\u5E94\u5355\u884C\u5B50\u67E5\u8BE2\uFF0C\u591A\u884C\u64CD\u4F5C\u7B26\u5BF9\u5E94\u591A\u884C\u5B50\u67E5\u8BE2</li></ul></li></ul><h3 id="\u5B50\u67E5\u8BE2\u7684\u5206\u7C7B" tabindex="-1"><a class="header-anchor" href="#\u5B50\u67E5\u8BE2\u7684\u5206\u7C7B" aria-hidden="true">#</a> \u5B50\u67E5\u8BE2\u7684\u5206\u7C7B</h3><p><strong>\u5206\u7C7B\u65B9\u5F0F1\uFF1A</strong></p><p>\u6211\u4EEC\u6309\u5185\u67E5\u8BE2\u7684\u7ED3\u679C\u8FD4\u56DE\u4E00\u6761\u8FD8\u662F\u591A\u6761\u8BB0\u5F55\uFF0C\u5C06\u5B50\u67E5\u8BE2\u5206\u4E3A<code>\u5355\u884C\u5B50\u67E5\u8BE2</code>\u3001<code>\u591A\u884C\u5B50\u67E5\u8BE2</code>\u3002</p><ul><li>\u5355\u884C\u5B50\u67E5\u8BE2</li></ul><p>\u200B <img src="https://s2.loli.net/2022/09/14/qdvafUjFXh5OyLZ.png" alt="1554991538719.png" loading="lazy"></p><ul><li>\u591A\u884C\u5B50\u67E5\u8BE2</li></ul><p>\u200B <img src="https://s2.loli.net/2022/09/14/dSplWg3Ybzwe146.png" alt="1554991555669.png" loading="lazy"></p><p><strong>\u5206\u7C7B\u65B9\u5F0F2\uFF1A</strong></p><p>\u6211\u4EEC\u6309\u5185\u67E5\u8BE2\u662F\u5426\u88AB\u6267\u884C\u591A\u6B21\uFF0C\u5C06\u5B50\u67E5\u8BE2\u5212\u5206\u4E3A<code>\u76F8\u5173(\u6216\u5173\u8054)\u5B50\u67E5\u8BE2</code>\u548C<code>\u4E0D\u76F8\u5173(\u6216\u975E\u5173\u8054)\u5B50\u67E5\u8BE2</code></p><p>\u5B50\u67E5\u8BE2\u4ECE\u6570\u636E\u8868\u4E2D\u67E5\u8BE2\u4E86\u6570\u636E\u7ED3\u679C\uFF0C\u5982\u679C\u8FD9\u4E2A\u6570\u636E\u7ED3\u679C\u53EA\u6267\u884C\u4E00\u6B21\uFF0C\u7136\u540E\u8FD9\u4E2A\u6570\u636E\u7ED3\u679C\u4F5C\u4E3A\u4E3B\u67E5\u8BE2\u7684\u6761\u4EF6\u8FDB\u884C\u6267\u884C\uFF0C\u90A3\u4E48\u8FD9\u6837\u7684\u5B50\u67E5\u8BE2\u53EB\u505A\u4E0D\u76F8\u5173\u5B50\u67E5\u8BE2</p><p>\u540C\u6837\uFF0C\u5982\u679C\u5B50\u67E5\u8BE2\u9700\u8981\u6267\u884C\u591A\u6B21\uFF0C\u5373\u91C7\u7528\u5FAA\u73AF\u7684\u65B9\u5F0F\uFF0C\u5148\u4ECE\u5916\u90E8\u67E5\u8BE2\u5F00\u59CB\uFF0C\u6BCF\u6B21\u90FD\u4F20\u5165\u5B50\u67E5\u8BE2\u8FDB\u884C\u67E5\u8BE2\uFF0C\u7136\u540E\u518D\u5C06\u7ED3\u679C\u53CD\u9988\u7ED9\u5916\u90E8\uFF0C\u8FD9\u79CD\u5D4C\u5957\u7684\u6267\u884C\u65B9\u5F0F\u5C31\u79F0\u4E3A\u76F8\u5173\u5B50\u67E5\u8BE2</p><h2 id="\u5355\u884C\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#\u5355\u884C\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> \u5355\u884C\u5B50\u67E5\u8BE2</h2><h3 id="\u5355\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26" tabindex="-1"><a class="header-anchor" href="#\u5355\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26" aria-hidden="true">#</a> \u5355\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26</h3><table><thead><tr><th>\u64CD\u4F5C\u7B26</th><th>\u542B\u4E49</th></tr></thead><tbody><tr><td>=</td><td>equal to</td></tr><tr><td>&gt;</td><td>greater than</td></tr><tr><td>&gt;=</td><td>greater than or equal to</td></tr><tr><td>&lt;</td><td>less than</td></tr><tr><td>&lt;=</td><td>less than or equal to</td></tr><tr><td>&lt;&gt; \u6216\u8005 !=</td><td>not equal to</td></tr></tbody></table><h3 id="having-\u4E2D\u7684\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#having-\u4E2D\u7684\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> HAVING \u4E2D\u7684\u5B50\u67E5\u8BE2</h3><ul><li>\u9996\u5148\u6267\u884C\u5B50\u67E5\u8BE2\u3002</li><li>\u5411\u4E3B\u67E5\u8BE2\u4E2D\u7684HAVING \u5B50\u53E5\u8FD4\u56DE\u7ED3\u679C</li></ul><div class="language-mysql ext-mysql line-numbers-mode"><pre class="language-mysql"><code>SELECT   department_id, MIN(salary)
FROM     employees
GROUP BY department_id
HAVING   MIN(salary) &gt;
                       (SELECT MIN(salary)
                        FROM   employees
                        WHERE  department_id = 50);
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="case\u4E2D\u7684\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#case\u4E2D\u7684\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> CASE\u4E2D\u7684\u5B50\u67E5\u8BE2</h3><div class="language-mysql ext-mysql line-numbers-mode"><pre class="language-mysql"><code>SELECT employee_id, last_name,
       (CASE department_id
        WHEN
             (SELECT department_id FROM departments
	      WHERE location_id = 1800)           
        THEN &#39;Canada&#39; ELSE &#39;USA&#39; END) location
FROM   employees;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="\u5B50\u67E5\u8BE2\u4E2D\u7684\u7A7A\u503C\u95EE\u9898" tabindex="-1"><a class="header-anchor" href="#\u5B50\u67E5\u8BE2\u4E2D\u7684\u7A7A\u503C\u95EE\u9898" aria-hidden="true">#</a> \u5B50\u67E5\u8BE2\u4E2D\u7684\u7A7A\u503C\u95EE\u9898</h3><p><img src="https://s2.loli.net/2022/09/14/ozTiSHr3gZKP8xL.png" alt="1554992067381.png" loading="lazy"></p><blockquote><p><strong>\u5B50\u67E5\u8BE2\u4E0D\u8FD4\u56DE\u4EFB\u4F55\u884C</strong></p></blockquote><h3 id="\u975E\u6CD5\u4F7F\u7528\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#\u975E\u6CD5\u4F7F\u7528\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> \u975E\u6CD5\u4F7F\u7528\u5B50\u67E5\u8BE2</h3><div class="language-mysql ext-mysql line-numbers-mode"><pre class="language-mysql"><code>SELECT employee_id, last_name
FROM   employees
WHERE  salary =
                (SELECT   MIN(salary)
                 FROM     employees
                 GROUP BY department_id);
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><img src="https://s2.loli.net/2022/09/14/TUYwkHeX4urm2M1.png" alt="1554992135819.png" loading="lazy"></p><blockquote><p><strong>\u591A\u884C\u5B50\u67E5\u8BE2\u4F7F\u7528\u5355\u884C\u6BD4\u8F83\u7B26</strong></p></blockquote><h2 id="\u591A\u884C\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#\u591A\u884C\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> \u591A\u884C\u5B50\u67E5\u8BE2</h2><ul><li>\u4E5F\u79F0\u4E3A\u96C6\u5408\u6BD4\u8F83\u5B50\u67E5\u8BE2</li><li>\u5185\u67E5\u8BE2\u8FD4\u56DE\u591A\u884C</li><li>\u4F7F\u7528\u591A\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26</li></ul><h3 id="\u591A\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26" tabindex="-1"><a class="header-anchor" href="#\u591A\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26" aria-hidden="true">#</a> \u591A\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26</h3><table><thead><tr><th>\u64CD\u4F5C\u7B26</th><th>\u542B\u4E49</th></tr></thead><tbody><tr><td>IN</td><td>\u7B49\u4E8E\u5217\u8868\u4E2D\u7684<strong>\u4EFB\u610F\u4E00\u4E2A</strong></td></tr><tr><td>ANY</td><td>\u9700\u8981\u548C\u5355\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26\u4E00\u8D77\u4F7F\u7528\uFF0C\u548C\u5B50\u67E5\u8BE2\u8FD4\u56DE\u7684<strong>\u67D0\u4E00\u4E2A</strong>\u503C\u6BD4\u8F83</td></tr><tr><td>ALL</td><td>\u9700\u8981\u548C\u5355\u884C\u6BD4\u8F83\u64CD\u4F5C\u7B26\u4E00\u8D77\u4F7F\u7528\uFF0C\u548C\u5B50\u67E5\u8BE2\u8FD4\u56DE\u7684<strong>\u6240\u6709</strong>\u503C\u6BD4\u8F83</td></tr><tr><td>SOME</td><td>\u5B9E\u9645\u4E0A\u662FANY\u7684\u522B\u540D\uFF0C\u4F5C\u7528\u76F8\u540C\uFF0C\u4E00\u822C\u5E38\u4F7F\u7528ANY</td></tr></tbody></table><blockquote><p>\u4F53\u4F1A ANY \u548C ALL \u7684\u533A\u522B</p></blockquote><h3 id="\u4EE3\u7801\u793A\u4F8B" tabindex="-1"><a class="header-anchor" href="#\u4EE3\u7801\u793A\u4F8B" aria-hidden="true">#</a> \u4EE3\u7801\u793A\u4F8B</h3><p><strong>\u67E5\u8BE2\u5E73\u5747\u5DE5\u8D44\u6700\u4F4E\u7684\u90E8\u95E8id</strong></p><div class="language-mysql ext-mysql line-numbers-mode"><pre class="language-mysql"><code>#\u65B9\u5F0F1\uFF1A
SELECT department_id
FROM employees
GROUP BY department_id
HAVING AVG(salary) = (
			SELECT MIN(avg_sal)
			FROM (
				SELECT AVG(salary) avg_sal
				FROM employees
				GROUP BY department_id
				) dept_avg_sal
			)
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><div class="language-mysql ext-mysql line-numbers-mode"><pre class="language-mysql"><code>#\u65B9\u5F0F2\uFF1A
SELECT department_id
FROM employees
GROUP BY department_id
HAVING AVG(salary) &lt;= ALL (
				SELECT AVG(salary) avg_sal
				FROM employees
				GROUP BY department_id
)
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="\u7A7A\u503C\u95EE\u9898" tabindex="-1"><a class="header-anchor" href="#\u7A7A\u503C\u95EE\u9898" aria-hidden="true">#</a> \u7A7A\u503C\u95EE\u9898</h3><p><img src="https://s2.loli.net/2022/09/14/IXWJCOqBMrfjzbQ.png" alt="image-20211027195906773.png" loading="lazy"></p><h2 id="\u76F8\u5173\u5B50\u67E5\u8BE2" tabindex="-1"><a class="header-anchor" href="#\u76F8\u5173\u5B50\u67E5\u8BE2" aria-hidden="true">#</a> \u76F8\u5173\u5B50\u67E5\u8BE2</h2><h3 id="\u76F8\u5173\u5B50\u67E5\u8BE2\u6267\u884C\u6D41\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u76F8\u5173\u5B50\u67E5\u8BE2\u6267\u884C\u6D41\u7A0B" aria-hidden="true">#</a> \u76F8\u5173\u5B50\u67E5\u8BE2\u6267\u884C\u6D41\u7A0B</h3><p>\u5982\u679C\u5B50\u67E5\u8BE2\u7684\u6267\u884C\u4F9D\u8D56\u4E8E\u5916\u90E8\u67E5\u8BE2\uFF0C\u901A\u5E38\u60C5\u51B5\u4E0B\u90FD\u662F\u56E0\u4E3A\u5B50\u67E5\u8BE2\u4E2D\u7684\u8868\u7528\u5230\u4E86\u5916\u90E8\u7684\u8868\uFF0C\u5E76\u8FDB\u884C\u4E86\u6761\u4EF6\u5173\u8054\uFF0C\u56E0\u6B64\u6BCF\u6267\u884C\u4E00\u6B21\u5916\u90E8\u67E5\u8BE2\uFF0C\u5B50\u67E5\u8BE2\u90FD\u8981\u91CD\u65B0\u8BA1\u7B97\u4E00\u6B21\uFF0C\u8FD9\u6837\u7684\u5B50\u67E5\u8BE2\u5C31\u79F0\u4E4B\u4E3A<code>\u5173\u8054\u5B50\u67E5\u8BE2</code>\u3002</p><p>\u76F8\u5173\u5B50\u67E5\u8BE2\u6309\u7167\u4E00\u884C\u63A5\u4E00\u884C\u7684\u987A\u5E8F\u6267\u884C\uFF0C\u4E3B\u67E5\u8BE2\u7684\u6BCF\u4E00\u884C\u90FD\u6267\u884C\u4E00\u6B21\u5B50\u67E5\u8BE2</p><p><img src="https://s2.loli.net/2022/09/14/mTrI5PAotqBH1QL.png" alt="1554992898234.png" loading="lazy"></p><p>\u8BF4\u660E\uFF1A<strong>\u5B50\u67E5\u8BE2\u4E2D\u4F7F\u7528\u4E3B\u67E5\u8BE2\u4E2D\u7684\u5217</strong></p><h3 id="\u4EE3\u7801\u793A\u4F8B-1" tabindex="-1"><a class="header-anchor" href="#\u4EE3\u7801\u793A\u4F8B-1" aria-hidden="true">#</a> \u4EE3\u7801\u793A\u4F8B</h3><p><strong>\u9898\u76EE\uFF1A\u67E5\u8BE2\u5458\u5DE5\u4E2D\u5DE5\u8D44\u5927\u4E8E\u672C\u90E8\u95E8\u5E73\u5747\u5DE5\u8D44\u7684\u5458\u5DE5\u7684last_name,salary\u548C\u5176department_id</strong></p><p><strong>\u65B9\u5F0F\u4E00\uFF1A\u76F8\u5173\u5B50\u67E5\u8BE2</strong></p><p><img src="https://s2.loli.net/2022/09/14/f6x1vKaANrt7P4H.png" alt="1554992986225.png" loading="lazy"></p><p><strong>\u65B9\u5F0F\u4E8C\uFF1A\u5728 FROM \u4E2D\u4F7F\u7528\u5B50\u67E5\u8BE2</strong></p><div class="language-sql ext-sql line-numbers-mode"><pre class="language-sql"><code><span class="token keyword">SELECT</span> last_name<span class="token punctuation">,</span>salary<span class="token punctuation">,</span>e1<span class="token punctuation">.</span>department_id
<span class="token keyword">FROM</span> employees e1<span class="token punctuation">,</span><span class="token punctuation">(</span><span class="token keyword">SELECT</span> department_id<span class="token punctuation">,</span><span class="token function">AVG</span><span class="token punctuation">(</span>salary<span class="token punctuation">)</span> dept_avg_sal <span class="token keyword">FROM</span> employees <span class="token keyword">GROUP</span> <span class="token keyword">BY</span> department_id<span class="token punctuation">)</span> e2
<span class="token keyword">WHERE</span> e1<span class="token punctuation">.</span><span class="token identifier"><span class="token punctuation">\`</span>department_id<span class="token punctuation">\`</span></span> <span class="token operator">=</span> e2<span class="token punctuation">.</span>department_id
<span class="token operator">AND</span> e2<span class="token punctuation">.</span>dept_avg_sal <span class="token operator">&lt;</span> e1<span class="token punctuation">.</span><span class="token identifier"><span class="token punctuation">\`</span>salary<span class="token punctuation">\`</span></span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><blockquote><p>from\u578B\u7684\u5B50\u67E5\u8BE2\uFF1A\u5B50\u67E5\u8BE2\u662F\u4F5C\u4E3Afrom\u7684\u4E00\u90E8\u5206\uFF0C\u5B50\u67E5\u8BE2\u8981\u7528()\u5F15\u8D77\u6765\uFF0C\u5E76\u4E14\u8981\u7ED9\u8FD9\u4E2A\u5B50\u67E5\u8BE2\u53D6\u522B\u540D\uFF0C \u628A\u5B83\u5F53\u6210\u4E00\u5F20\u201C\u4E34\u65F6\u7684\u865A\u62DF\u7684\u8868\u201D\u6765\u4F7F\u7528\u3002</p></blockquote><p>\u5728ORDER BY \u4E2D\u4F7F\u7528\u5B50\u67E5\u8BE2\uFF1A</p><p><strong>\u9898\u76EE\uFF1A\u67E5\u8BE2\u5458\u5DE5\u7684id,salary,\u6309\u7167department_name \u6392\u5E8F</strong></p><div class="language-sql ext-sql line-numbers-mode"><pre class="language-sql"><code><span class="token keyword">SELECT</span> employee_id<span class="token punctuation">,</span>salary
<span class="token keyword">FROM</span> employees e
<span class="token keyword">ORDER</span> <span class="token keyword">BY</span> <span class="token punctuation">(</span>
	  <span class="token keyword">SELECT</span> department_name
	  <span class="token keyword">FROM</span> departments d
	  <span class="token keyword">WHERE</span> e<span class="token punctuation">.</span><span class="token identifier"><span class="token punctuation">\`</span>department_id<span class="token punctuation">\`</span></span> <span class="token operator">=</span> d<span class="token punctuation">.</span><span class="token identifier"><span class="token punctuation">\`</span>department_id<span class="token punctuation">\`</span></span>
	<span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="exists-\u4E0E-not-exists\u5173\u952E\u5B57" tabindex="-1"><a class="header-anchor" href="#exists-\u4E0E-not-exists\u5173\u952E\u5B57" aria-hidden="true">#</a> EXISTS \u4E0E NOT EXISTS\u5173\u952E\u5B57</h3><ul><li>\u5173\u8054\u5B50\u67E5\u8BE2\u901A\u5E38\u4E5F\u4F1A\u548C EXISTS\u64CD\u4F5C\u7B26\u4E00\u8D77\u6765\u4F7F\u7528\uFF0C\u7528\u6765\u68C0\u67E5\u5728\u5B50\u67E5\u8BE2\u4E2D\u662F\u5426\u5B58\u5728\u6EE1\u8DB3\u6761\u4EF6\u7684\u884C\u3002</li><li><strong>\u5982\u679C\u5728\u5B50\u67E5\u8BE2\u4E2D\u4E0D\u5B58\u5728\u6EE1\u8DB3\u6761\u4EF6\u7684\u884C\uFF1A</strong><ul><li>\u6761\u4EF6\u8FD4\u56DE FALSE</li><li>\u7EE7\u7EED\u5728\u5B50\u67E5\u8BE2\u4E2D\u67E5\u627E</li></ul></li><li><strong>\u5982\u679C\u5728\u5B50\u67E5\u8BE2\u4E2D\u5B58\u5728\u6EE1\u8DB3\u6761\u4EF6\u7684\u884C\uFF1A</strong><ul><li>\u4E0D\u5728\u5B50\u67E5\u8BE2\u4E2D\u7EE7\u7EED\u67E5\u627E</li><li>\u6761\u4EF6\u8FD4\u56DE TRUE</li></ul></li><li>NOT EXISTS\u5173\u952E\u5B57\u8868\u793A\u5982\u679C\u4E0D\u5B58\u5728\u67D0\u79CD\u6761\u4EF6\uFF0C\u5219\u8FD4\u56DETRUE\uFF0C\u5426\u5219\u8FD4\u56DEFALSE</li></ul><p><strong>\u9898\u76EE\uFF1A\u67E5\u8BE2\u516C\u53F8\u7BA1\u7406\u8005\u7684employee_id\uFF0Clast_name\uFF0Cjob_id\uFF0Cdepartment_id\u4FE1\u606F</strong></p><p>\u65B9\u5F0F\u4E00\uFF1A</p><div class="language-sql ext-sql line-numbers-mode"><pre class="language-sql"><code><span class="token keyword">SELECT</span> employee_id<span class="token punctuation">,</span> last_name<span class="token punctuation">,</span> job_id<span class="token punctuation">,</span> department_id
<span class="token keyword">FROM</span>   employees e1
<span class="token keyword">WHERE</span>  <span class="token keyword">EXISTS</span> <span class="token punctuation">(</span> <span class="token keyword">SELECT</span> <span class="token operator">*</span>
                 <span class="token keyword">FROM</span>   employees e2
                 <span class="token keyword">WHERE</span>  e2<span class="token punctuation">.</span>manager_id <span class="token operator">=</span> 
                        e1<span class="token punctuation">.</span>employee_id<span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>\u65B9\u5F0F\u4E8C\uFF1A\u81EA\u8FDE\u63A5</p><div class="language-sql ext-sql line-numbers-mode"><pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token keyword">DISTINCT</span> e1<span class="token punctuation">.</span>employee_id<span class="token punctuation">,</span> e1<span class="token punctuation">.</span>last_name<span class="token punctuation">,</span> e1<span class="token punctuation">.</span>job_id<span class="token punctuation">,</span> e1<span class="token punctuation">.</span>department_id
<span class="token keyword">FROM</span>   employees e1 <span class="token keyword">JOIN</span> employees e2
<span class="token keyword">WHERE</span> e1<span class="token punctuation">.</span>employee_id <span class="token operator">=</span> e2<span class="token punctuation">.</span>manager_id<span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>\u65B9\u5F0F\u4E09\uFF1A</p><div class="language-sql ext-sql line-numbers-mode"><pre class="language-sql"><code><span class="token keyword">SELECT</span> employee_id<span class="token punctuation">,</span>last_name<span class="token punctuation">,</span>job_id<span class="token punctuation">,</span>department_id
<span class="token keyword">FROM</span> employees
<span class="token keyword">WHERE</span> employee_id <span class="token operator">IN</span> <span class="token punctuation">(</span>
		     <span class="token keyword">SELECT</span> <span class="token keyword">DISTINCT</span> manager_id
		     <span class="token keyword">FROM</span> employees
		     
		     <span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><blockquote><p>\u9898\u76EE\u4E2D\u53EF\u4EE5\u4F7F\u7528\u5B50\u67E5\u8BE2\uFF0C\u4E5F\u53EF\u4EE5\u4F7F\u7528\u81EA\u8FDE\u63A5\u3002\u4E00\u822C\u60C5\u51B5\u5EFA\u8BAE\u4F60\u4F7F\u7528\u81EA\u8FDE\u63A5\uFF0C\u56E0\u4E3A\u5728\u8BB8\u591A DBMS \u7684\u5904\u7406\u8FC7\u7A0B\u4E2D\uFF0C\u5BF9\u4E8E\u81EA\u8FDE\u63A5\u7684\u5904\u7406\u901F\u5EA6\u8981\u6BD4\u5B50\u67E5\u8BE2\u5FEB\u5F97\u591A\u3002</p><p>\u53EF\u4EE5\u8FD9\u6837\u7406\u89E3\uFF1A\u5B50\u67E5\u8BE2\u5B9E\u9645\u4E0A\u662F\u901A\u8FC7\u672A\u77E5\u8868\u8FDB\u884C\u67E5\u8BE2\u540E\u7684\u6761\u4EF6\u5224\u65AD\uFF0C\u800C\u81EA\u8FDE\u63A5\u662F\u901A\u8FC7\u5DF2\u77E5\u7684\u81EA\u8EAB\u6570\u636E\u8868\u8FDB\u884C\u6761\u4EF6\u5224\u65AD\uFF0C\u56E0\u6B64\u5728\u5927\u90E8\u5206 DBMS \u4E2D\u90FD\u5BF9\u81EA\u8FDE\u63A5\u5904\u7406\u8FDB\u884C\u4E86\u4F18\u5316</p></blockquote>`,68),l=[i];function d(p,r){return a(),s("div",null,l)}var u=n(t,[["render",d],["__file","chapter5.html.vue"]]);export{u as default};
